goog.provide("goog.locale.timeZoneDetectionTest");goog.setTestOnly("goog.locale.timeZoneDetectionTest");goog.require("goog.locale.timeZoneDetection");goog.require("goog.testing.jsunit");function MockDate(){this.timezoneOffset_=[];this.offsetArrayCounter_=0}MockDate.prototype.setTime=function(ms){};MockDate.prototype.setTimezoneOffset=function(offset){this.timezoneOffset_=offset};MockDate.prototype.getTimezoneOffset=function(){return 1<this.timezoneOffset_.length?this.timezoneOffset_[this.offsetArrayCounter_++]:this.timezoneOffset_[0]};function testGetFingerprint(){var mockDate=new MockDate;mockDate.setTimezoneOffset([-480]);var fingerprint=goog.locale.timeZoneDetection.getFingerprint(mockDate);assertEquals(32,fingerprint);mockDate=new MockDate;mockDate.setTimezoneOffset([480,420,420,480,480,420,420,420,420,420,420,420,420]);fingerprint=goog.locale.timeZoneDetection.getFingerprint(mockDate);assertEquals(1294772902,fingerprint)}function testDetectTimeZone(){var mockDate=new MockDate;mockDate.setTimezoneOffset([-480]);var timeZoneId=goog.locale.timeZoneDetection.detectTimeZone(void 0,mockDate);assertEquals("Asia/Hong_Kong",timeZoneId);mockDate=new MockDate;mockDate.setTimezoneOffset([480,420,420,480,480,420,420,420,420,420,420,420,420]);timeZoneId=goog.locale.timeZoneDetection.detectTimeZone("US",mockDate);assertEquals("America/Los_Angeles",timeZoneId);mockDate=new MockDate;mockDate.setTimezoneOffset([480,420,420,480,480,420,420,420,420,420,420,420,420]);timeZoneId=goog.locale.timeZoneDetection.detectTimeZone("CA",mockDate);assertEquals("America/Dawson",timeZoneId)}function testGetTimeZoneList(){var mockDate=new MockDate;mockDate.setTimezoneOffset([480,420,420,480,480,420,420,420,420,420,420,420,420]);var timeZoneList=goog.locale.timeZoneDetection.getTimeZoneList(void 0,mockDate);assertEquals("America/Los_Angeles",timeZoneList[0]);assertEquals("America/Whitehorse",timeZoneList[4]);assertEquals(5,timeZoneList.length);mockDate=new MockDate;mockDate.setTimezoneOffset([-480]);timeZoneList=goog.locale.timeZoneDetection.getTimeZoneList(void 0,mockDate);assertEquals("Asia/Hong_Kong",timeZoneList[0]);assertEquals("Asia/Chongqing",timeZoneList[7]);assertEquals(16,timeZoneList.length);timeZoneList=goog.locale.timeZoneDetection.getTimeZoneList("AU",mockDate);assertEquals(1,timeZoneList.length);assertEquals("Australia/Perth",timeZoneList[0])}